import React , { useState, useEffect }from "react";
import "../Style_Pages/New_Users_Queue.css";
import Header from "../Components/Header";
import Footer from "../Components/Footer";
import { getAuthUser } from "../helper/storage";
import axios from "axios";

export const History = () => {
  const auth = getAuthUser();
  const [histories, setHistory] = useState({
    loading: true,
    results: [],
    err: null,
    reload: 0,
  });

  useEffect(() => {
    setHistory({ ...histories, loading: true });
    axios
      .get("http://localhost:4000/histories/2")
      .then((resp) => {
        setHistory({ ...histories, results: resp.data, loading: false, err: null });
        console.log(resp);
      })
      .catch((err) => {
        setHistory({
          ...histories,
          loading: false,
          err: " something went wrong, please try again later ! ",
        });
      });
  }, [histories.reload]);
  return (
    <>
      <Header />

      <div className="table_container">
        <table>
          <thead>
            <tr>
              <th>Exam Id</th>
              <th>Degree</th>
              <th>Email</th>
              <th>Date</th>
            </tr>
          </thead>
          <tbody>
          {
          histories.results.map((history) => (
            <tr>
              <td>key={history.id}</td>
              <td>90%</td>
              <td>Mohamed.Ali@example.com</td>
              <td>15 Apr,2023</td>
            </tr>

          ))}
          </tbody>
        </table>
      </div>

      <Footer />
    </>
  );
};
